import React, { Component } from "react";
import Accordion from 'react-bootstrap/Accordion'
import {Card} from 'react-bootstrap';
class SideBarItem extends Component {
  
  render() {
    const { document } = this.props;
    return (

    <div className="row" id="main-content">
      <Accordion defaultActiveKey="0" className="col-4 collapse show d-md-flex bg-light min-vh-100 border border-left-0" id="sidebar">
       <Card className="nav flex-column flex-nowrap overflow-hidden "className="nav flex-column flex-nowrap overflow-hidden ">
      <Card.Header className="nav-item">
        <Accordion.Toggle as={document.subject} variant="link" eventKey="0" className="p-2">
        {document.subject} 
        </Accordion.Toggle>
      </Card.Header>
      <Accordion.Collapse eventKey="0" className="nav-link collapsed text-truncate">
        <Card.Body className="d-none d-sm-inline side-nav-title">{document.topic}</Card.Body>
      </Accordion.Collapse>
    </Card>
  </Accordion>  
    </div>
    


    );
  }
}

export default SideBarItem;
